import "bootstrap/dist/css/bootstrap.css";
import Goodiespage from "../components/Goodiespage";

const Goodies = () => {
  return (
    <div>

      <Logo />
      <Navigation />
      <Goodiespage />

      </div>

  );
};

export default Goodies;
